import React from 'react';

const Schedule = () => {

const [doctors, setDoctors] = useState([]);

useEffect(() => {
  fetch('/appointments.json') 
    .then((res) => res.json())
    .then((result) => {
      console.log('Fetched Data:', result);
      setDoctors(result);
    })
    .catch((error) => {
      console.error('Error fetching data:', error);
    });
}, []);
  return (
    <div className='assign'>
        <u><p className='home-logout'><a href='/SignInPage'>logout</a></p></u>
        <h1 className='header2'>YOUR Schedule</h1>
        <table >
          <thead>
           <tr >
            <th>Day</th>
            <th>start_time</th>
            <th>end_time</th>
           </tr>
          </thead>
          <tbody>
           <tr>
            <td>{state.Day}</td>
            <td>{state.start_time}</td>
            <td>{state.end_time}</td>
           </tr>
           <tr>
            <td>{state2.Day}</td>
            <td>{state2.start_time}</td>
            <td>{state2.end_time}</td>
           </tr>

          </tbody>
        </table>
        <br />
        <br />
        <label className='organize'>Day</label>
        <input type='text' id='appointmentDay'/>
        <label className='organize' id='appointmentStart'>Start-Time</label>
        <input type='text'/>
        <label className='organize'id='appointmentEnd'>end-Time</label>
        <input type='text'/>
        <button className='organize'>Insert</button>
        <button ><a href='/'>Back</a></button>

    </div>
    
      
    
  );
  
};

export default Schedule;
